import React, { useState } from 'react';
import NavbarTop from './NavbarTop';

import badgedisabled from '../img/badgedisabled.svg';
import badgeenabled from '../img/badgeenabled.svg';
import lessonicon from '../img/lessonicon.svg';
import lessonicon2 from '../img/lessonicon2.svg';

let lessoList = [
	{
		id: 0,
		title: 'Basics training',
		badgeImg: badgeenabled,
		lessonImg: lessonicon
	},
	{
		id: 1,
		title: 'Core training',
		badgeImg: badgedisabled,
		lessonImg: lessonicon2
	}
];

export default function Dashboard() {
	return (
		<article>
			<header>
				<NavbarTop />
			</header>
			<body>
				<div style={styles.container}>
					{lessoList.map(lesson => (
						<LessonElement
							lessonImg={lesson.lessonImg}
							badge={lesson.badgeImg}
							title={lesson.title}
						/>
					))}
				</div>
			</body>
		</article>
	);
}

function LessonElement(props) {
	return (
		<div style={styles.container}>
			<img
				src={props.lessonImg}
				style={{
					height: '20vmin',
					background: '#dae1e7ff',
					borderRadius: '50%',
					padding: '20px'
				}}
			/>
			<LessonTitle badge={props.badge} />
		</div>
	);
}

function LessonTitle(props) {
	return (
		<div style={styles.rowContainer}>
			<img
				src={props.badge}
				style={{
					height: '5vmin'
				}}
			/>
			<p
				style={{
					fontWeight: '700',
					color: 'rgb(87, 86, 92)',
					fontFamily: 'din-round, sans-serif'
				}}
			>
				Basics training
			</p>
		</div>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonElement: {
		height: '15vmin'
	},
	container: {
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'center',
		fontSize: 'calc(10px + 2vmin)'
	},
	rowContainer: {
		height: '100%',
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'top',
		justifyContent: 'center'
	}
};
// export default Dashboard;
